contents:
와~
진짜
도둑의힘과언론들의협작질이장난이아니구나;;
나라를거꾸로돌리려는매국노들
정부험담만으로권력을찬탈하려구난리야;;
정말너무심각하다..

공무원수 늘려서 가족들 시다발이로 이용하고 &gt;&gt;월급은 국민 , 기업  등친 세금으로 주셨네요&gt;&gt;
기가막힐  노릇이네&gt;.
지난번 군장성  짤린것을 모두 일고 있는데 &lt;&lt;&lt;&lt;사과가 아니고 빨리 대선후보서 물러나는게 맞는것 같아요

그당은 왜 당차원에서 방송금지 신청에 원내대표가 항의방문에 그 전날 보좌진 몇십명이 간다 했는지. // 신상문제 의혹 해결? 사실 여부야 정확히 알수 없지만 본인이 말로만 안했다 하면 안한것이 되는것?  그리고 나이트 싫어 한다는데 나이트 이야기를 했던것도 아니고  핵심은  거론된 건물 에서 회장을 만났는지 여부임
// 모 검사 이야기 그동안 여행설 검사는 모른다 모른다 부정 하고 했는데 오히려 본인 스스로 갔다고 
 인정함 그런데도 법무부 출입국 기록은 왜 없을가?
// 무속 관련 이야기 본인이 영적이고 더 잘본다는 
 말도.
